import { Component, OnInit } from '@angular/core';
import {AuthService} from '../../../../services/auth.service'

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss'],
})
export class HeaderComponent implements OnInit {
  constructor(private authService: AuthService) {}
  ngOnInit(): void {}
  logout() {
this.authService.logout();
  }
}
<header class="bg-white">
  <nav
    class="mx-auto flex max-w-xl items-center justify-around p-10 sm:px-8"
    aria-label="Global"
  >
    <div class="hidden lg:flex lg:gap-x-12">
      <a
        routerLinkActive="active"
        routerLink="./home"
        class="text-sm font-bold leading-6 text-gray-900"
        >Home</a
      >
    </div>
    <div class="hidden lg:flex lg:flex-1 lg:justify-end">
      <button (click)="logout()">
      <a href="#" class="text-sm font-bold leading-6 text-gray-900"
        >Log out <span aria-hidden="true">&rarr;</span></a
      ></button>
    </div>
  </nav>
</header>
